import { Container, Col, Row, Navbar } from "react-bootstrap";
import "./ShopifySoloution.css"


class ShopifySoloution extends Component {
    render(){
        return(
            <div>
                Shopify solutions

1. Shopify store setup: We could help businesses create and set up their Shopify store, including choosing a theme, setting up payment and shipping options, and configuring basic store settings.
2. Store customization: We could help businesses customize their Shopify store by modifying existing ones, adjusting layout, adding functionality, and integrating third-party apps.
3. Product and collection organization: We could help businesses organize their products and collections in a logical and user-friendly way, ensuring that products are easy to find and purchase.
4. Flow setup: Add workflows based on business needs to make fulfillment and follow up as efficient as possible
5. Inventory organization: Having this system optimized is crucial for the ability of your web store being able to scale with business need while maintaining easy navigation
            </div>

        )
    }
}
export default ShopifySoloution
